import React from 'react';

export default class Interests extends React.Component {
    state = {
        page: 0
    }


    render() {
        return (

            <div>

                <h1>Interests</h1>
                <ul>
                    <li>Sci-fi</li>
                    <li>Garageband / music making</li>
                    <li>Photography</li>
                </ul>

            </div>

        )
    }

}
